function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/about">
          <About></About>
        </Route>
        <Route path="/" exact>
          <Landing></Landing>
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
